import React from "react"
// import { BrowserRouter as Router, Route, Link } from "react-router-dom"
// const SvenskaSpelApi ="https://api.www.svenskaspel.se/player/sponsorship/autocomplete?search=stockholm&numResponses=20"

class ExerciseForm extends React.Component {

  constructor(props) {
    super(props)
    this.state = {
      count: 0
    }
  }

  addTwoPoints() {
    this.setState({
      count: this.state.count + 2
    })
  }
  addFivePoints() {
    this.setState({
      count: this.state.count + 5
    })
  }
  addThreePoints() {
    this.setState({
      count: this.state.count + 3
    })
  }

  render() {
    return (
      <div>
        <form>
          <label>
            10 Situps (2 p)
            <input type="checkbox" value="Strenght" onClick={this.addTwoPoints} />
          </label>
          <label>
            15 Burpees (3 p)
            <input type="checkbox" value="Fitness" onClick={this.addThreePoints} />
          </label>
          <label>
            20 min jogging (5 p)
            <input type="checkbox" value="Flexability" onClick={this.addFivePoints} />
          </label>
        </form>
      </div>
    )
  }

}

export default ExerciseForm
